import { registerDynImportEntry } from 'js/moduleLoader';
;
export default {
    "schemaVersion": "1.0.0",
    "syncStrategies": {
        "pwaToSWASyncObject": {
            "source": {
                "view": "AwPrimaryWorkarea",
                "port": "pwaSelection"
            },
            "target": {
                "view": "AwSecondaryWorkarea",
                "port": "swaSelectionInput"
            }
        }
    },
    "syncStrategyHandlers": {
        "pwaToSwaSyncHandler": {
            "id": "pwaToSWASyncObject",
            "activeWhen": true
        }
    }
};
